import React, {useState} from 'react';
import { NavLink, useNavigate } from 'react-router-dom';
/* import {
    MDBBtn,
    MDBContainer,
    MDBCard,
    MDBCardBody,
    MDBInput,
    MDBCheckbox
  }
    from 'mdb-react-ui-kit'; 
  import './Signup.css'; */

const Signup = () => {

  const navigate = useNavigate();
  //navigate("/");
  const [user,setUser] = useState({
    name: "", email: "", phone: "", work: "", password: "", cpassword: ""
  });

  let name, value;

  const handleInputs = (e) => {
    console.log(e);
    name = e.target.name;
    value = e.target.value;

    setUser({...user, [name]:value});

  }

  const PostData = async (e) => {
    e.preventDefault();

    const { name, email, phone, work, password, cpassword } = user;
    
    const res = await fetch("/signup", {
      method: "POST",
      headers: {
        "Content-Type" : "application/json" 
      },
      body: JSON.stringify({
        name, email, phone, work, password, cpassword
      
      })
    });

    const data = await res.json();

    if(res.status === 422 || !data) {
      window.alert("Invalid Registration");
      console.log("Invalid Registration");
    } else {
      window.alert("Successful Registration");
      console.log("Successful Registration");

      navigate.push("/login");
    }
  }
  return (
    <>
     <section className='signup'>
        <div className='container mt-5'>
            <div className='signup-content'>
                <div className='signup-form'>
                    <h2 className='form-title'>Sign up</h2>
                    <form method="POST" className='register-form' id='register-form'>
                    <div className='form-group'>
                    <label htmlFor='name'>
                    <i class="zmdi zmdi-account material-icon-name"></i>
                    </label>
                    <input type="text" name="name" id="name" autoComplete='off' 
                    value={user.name}
                    onChange={handleInputs}
                    placeholder='Your Name'
                    />
                </div> 

                <div className='form-group'>
                    <label htmlFor='email'>
                    <i class="zmdi zmdi-email material-icon-name"></i>
                    </label>
                    <input type="text" name="email" id="email" autoComplete='off' 
                    value={user.email}
                    onChange={handleInputs}
                    placeholder='Your Email'
                    />
                </div> 

                <div className='form-group'>
                    <label htmlFor='phone'>
                    <i class="zmdi zmdi-phone material-icon-name"></i>
                    </label>
                    <input type="number" name="phone" id="phone" autoComplete='off' 
                    value={user.phone}
                    onChange={handleInputs}
                    placeholder='Your Phone Number'
                    />
                </div> 

                <div className='form-group'>
                    <label htmlFor='work'>
                    <i class="zmdi zmdi-slideshow material-icon-name"></i>
                    </label>
                    <input type="text" name="work" id="work" autoComplete='off' 
                    value={user.work}
                    onChange={handleInputs}
                    placeholder='Your Profession'
                    />
                </div> 

                <div className='form-group'>
                    <label htmlFor='password'>
                    <i class="zmdi zmdi-lock material-icon-name"></i>
                    </label>
                    <input type="password" name="password" id="password" autoComplete='off' 
                    value={user.password}
                    onChange={handleInputs}
                    placeholder='Your Password'
                    />
                  </div>

                <div className='form-group'>
                    <label htmlFor='cpassword'>
                    <i class="zmdi zmdi-lock material-icon-name"></i>
                    </label>
                    <input type="password" name="cpassword" id="cpassword" autoComplete='off' 
                    value={user.cpassword}
                    onChange={handleInputs}
                    placeholder='Confirm Password'
                    />
                </div> 

                <div className='form-group form-button'>
                  <input type="submit" name="signup" id="signup" className="form-submit"
                      value="Register" onClick={PostData}
                  />
                </div>
                    </form>
                </div> 
                    <div className='signup'>
                   <NavLink to='/login' className='signup-link'>I'm already Register</NavLink>
                   </div> 
            </div>
        </div>
     </section>
    </>
  )
}



export default Signup
